import '../../App.css';
import './Header.css';
import style from './DropDown/DropDown.module.css';

const Header = () => {
    return (
    <header className="grid-header">
        <div className="headerQ">
            <div className="logotopQ">
                <img src={logo} height="50"/>
                WWSI social..
